		"id_str": "1155522613835259904",
		"full_text": "개인적으로 느끼는 울음의 효과는 진정이나 해소보다 '깨달음'에 있는 거 같음. 힘듦이 쌓이고 있었지만 잘 모르고 있다가 예기치 않는 사건으로 울고나면 아 내가 이것 때문에 힘들었구나 하고 깨달음이 올 때가 있다. 나한테 울음은 감정이 둔한 나한테 좀 알아차리라고 외치는 과정 같음",
