		"text": "#노래가슬퍼도인생은아름답기를 포스터 b컷들.  무척 마음에 드는 작업이었습니다. 제가 사랑하는 최고의 여성 전문가들과 함께하는 작업은 언제나 감사합니다. 🥰❤️❤️❤️\n메이크업아티스트_김활란 MUSÉE NEUF \n헤어스타일리스트_김주희 MUSÉE NEUF \n스타일리스트_오영주 oh_cinq \n포토그래퍼_김재민 https://t.co/eGwKCJGVhX"
